import { NextApiRequest, NextApiResponse } from 'next'
import jsonResult from '../../shared/functions/convertDatasetToJson'

const blog = (req: NextApiRequest, res: NextApiResponse) => {
  res.json(JSON.stringify(jsonResult()[0], null, 2))
}

export default blog
